    [],nt"num_tags": 5,nt"name": "annual-predator-management-report-1995",nt"isopen":
    false,nt"url": null,nt"notes": "Seedskadee NWR initiated its eighth consecutive
    year of predator management in June of 1995. The purpose of this management is to
    selectively remove waterfowl nest predators in order to increase waterfowl nesting
    success and to meet the refuge's waterfowl production objectives. A predator management
    and duck nesting success study was initiated in 1987. This was superseded by a predator
    management plan in 1991. Predator management is currently conducted under the guidelines
    of the plan. In general, the guidelines allow trapping of three predator species
    within the vicinity of refuge wetlands during the waterfowl nesting season. Targeted
    predator species include the striped skunk (Hephitis mephitis) , raccoon (Procyon
    lotor) , and red fox (Vulpes vulpes).",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
